import React from 'react';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import {Home, About} from './works';

export default class NavBar extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    return (
      <div>
        <Route exact path="/" component={Home} />
        <Route path="/about" component={About} />

          <Navbar toggleable="sm" color="white" light expand="md">
            <NavbarBrand href="/"><h1 className="name-title">Anabella Volpi</h1></NavbarBrand>
            <NavbarToggler onClick={this.toggle} />
            <Collapse isOpen={this.state.isOpen} navbar>
              {/* Mobile nav */}
              <Nav className="ml-auto d-none d-sm-block d-md-none" navbar>
                <NavItem>
                  <NavLink href="/components/">LinkedIn</NavLink>
                </NavItem>
                <NavItem>
                  <NavLink href="https://github.com/reactstrap/reactstrap">About</NavLink>
                </NavItem>
                <UncontrolledDropdown nav inNavbar>
                  <DropdownToggle nav caret>
                    Links
                  </DropdownToggle>
                  <DropdownMenu right>
                    <DropdownItem>
                    <NavItem>
                      <NavLink href="/components/">LinkedIn</NavLink>
                    </NavItem>
                    </DropdownItem>
                    <DropdownItem>
                    <NavItem>
                      <NavLink href="/components/">About</NavLink>
                    </NavItem>
                    </DropdownItem>
                  </DropdownMenu>
                </UncontrolledDropdown>
              </Nav>
              {/* Desktop nav */}
              <Nav className="ml-auto d-none d-md-block" navbar>
                <Link to="/">Home</Link>
                <Link to="/about">About</Link>
                {/* <NavItem>
                  <NavLink href="/components/">LinkedIn</NavLink>
                </NavItem>
                <NavItem>
                  <NavLink href="https://github.com/reactstrap/reactstrap">About</NavLink>
                </NavItem> */}
              </Nav>
            </Collapse>
          </Navbar>
      </div>
    );
  }
}
